page_script({init:function(){$("#message_form").ajaxForm({beforeSubmit:function(){$(".success_msg",$("#message_form")).hide();$(".unhandled_error",$("#message_form")).hide()},success:function(e){try{parsed=JSON.parse(e);if(parsed.status=="success"){$(".success_msg",$("#message_form")).show()}else{console.log(e);$(".unhandled_error",$("#message_form")).show()}}catch(f){console.log(e);$(".unhandled_error",$("#message_form")).show()}}});var b=new google.maps.LatLng(35.86384047540425,10.544368078851221);var c={scrollwheel:false,zoom:13,center:b};var d=new google.maps.Map($("#contactmap")[0],c);var a=new google.maps.Marker({position:b});a.setMap(d)}});